INSERT [dbo].[GameComments] ([Id], [GameId], [MemberId], [Content], [Score], [CreatedTime], [ActiveFlag], [DeleteDatetime], [DeleteBackendMemberId]) VALUES (1, 10, 12, N'是一款極富競爭性的多人射擊遊戲。遊戲中有多種不同的英雄角色可供玩家選擇，每個角色都擁有獨特的技能和特點。遊戲的團隊合作要素非常重要，玩家需要與隊友緊密合作，採取策略並利用各自的角色技能來擊敗對手。遊戲的快節奏和刺激的戰鬥讓人難以放下手中的控制器。遊戲的圖形和音效非常出色，使得整個遊戲世界更加生動。無論是想要挑戰自己的技能還是與朋友一起組隊對戰，"Overwatch"都能提供一個令人興奮的遊戲體驗。總的來說，這款遊戲在競技性和娛樂性方面都非常出色，是一款值得一玩的遊戲。', 4, CAST(N'2023-01-08T11:32:45.000' AS DateTime), 1, NULL, NULL)
GO
