INSERT [dbo].[Games] ([Id], [ChiName], [EngName], [Description], [IsRestrict], [GameCoverImg], [CreatedTime], [CreatedBackendMemberId], [ModifiedTime], [ModifiedBackendMemberId]) VALUES (1, N'薩爾達傳說 曠野之息', N'The Legend of Zelda: Breath of the Wild', N'傳說中，每當邪惡的古老惡魔——災厄加儂降臨海拉魯王國並帶來不幸時，兩位光之勇者——女神海利亞後代的光明公主和她的騎士，都能成功地擊敗邪惡並帶回和平。海拉魯王國內的人們決定用他們先進的科技製造出守護者和四隻巨大的神獸用以協助勇者。當災厄加儂再度降臨時，勇者和公主成功地將其再次封印。', 0, N'Zelda01.jpg', CAST(N'2018-02-01T00:00:00.000' AS DateTime), 3, NULL, NULL)
GO
INSERT [dbo].[Games] ([Id], [ChiName], [EngName], [Description], [IsRestrict], [GameCoverImg], [CreatedTime], [CreatedBackendMemberId], [ModifiedTime], [ModifiedBackendMemberId]) VALUES (2, N'薩爾達傳說 王國之淚', N'The Legend of Zelda: Tears of the Kingdom', N'本作承接前作《曠野之息》的劇情，在與騎士林克共同戰勝惡魔災厄加儂後，薩爾達公主與林克合力開始復興海拉魯王國。故事從薩爾達與林克共同前往海拉魯城堡地下調查瘴氣開始，兩人在地下洞窟發現了古老文明左納烏的遺蹟，隨後薩爾達又與林克在城堡地下的更深處發現了插著一隻發光手臂的加儂（加儂多夫）的屍體，手臂掉落，薩爾達撿到了手臂上的秘石。這具屍體在他們靠近後突然復活，林克為了保護薩爾達而身受重傷，手臂遭到瘴氣侵蝕，他的武器大師之劍也因此腐朽；薩爾達則掉進了崩塌的地面後失蹤。林克試圖抓住薩爾達的手但是失敗，他被發光手臂抓住，帶上了空島。', 0, N'Zelda02.jpg', CAST(N'2023-05-12T00:00:00.000' AS DateTime), 3, NULL, NULL)
GO
INSERT [dbo].[Games] ([Id], [ChiName], [EngName], [Description], [IsRestrict], [GameCoverImg], [CreatedTime], [CreatedBackendMemberId], [ModifiedTime], [ModifiedBackendMemberId]) VALUES (3, N'集合啦！動物森友會', N'Animal Crossing: New Horizons', N'由任天堂所推出的社交模擬系列，遊戲中玩家生活在一個由擬人動物居住的村莊，展開各種活動。 系列以其開放性著稱，並大量使用遊戲機內建時鐘和日曆模擬真實時間', 0, N'Animal.jpg', CAST(N'2020-03-20T00:00:00.000' AS DateTime), 3, NULL, NULL)
GO
INSERT [dbo].[Games] ([Id], [ChiName], [EngName], [Description], [IsRestrict], [GameCoverImg], [CreatedTime], [CreatedBackendMemberId], [ModifiedTime], [ModifiedBackendMemberId]) VALUES (4, N'寶可夢 朱／紫', N'Pokemon Scarlet & Violet', N'在《寶可夢 朱／紫》中，玩家扮演橘子學院或葡萄學院的學生，並參加學院舉辦的尋寶活動。該活動鼓勵學生向外探索，尋找「寶物」。主角遇見失去戰鬥能力的傳說寶可夢故勒頓或密勒頓，該寶可夢會成為玩家的坐騎。之後玩家需進行三個故事：冠軍之路、星塵之路和傳說之路。', 0, N'Pokemon01.jpg', CAST(N'2023-06-21T00:00:00.000' AS DateTime), 3, NULL, NULL)
GO
INSERT [dbo].[Games] ([Id], [ChiName], [EngName], [Description], [IsRestrict], [GameCoverImg], [CreatedTime], [CreatedBackendMemberId], [ModifiedTime], [ModifiedBackendMemberId]) VALUES (5, N'寶可夢傳說 阿爾宙斯', N'Pokemon Legends Arceus', N'故事發生在人類與寶可夢還未生活在一起的遙遠過去，主角作為駐紮在祝慶村的銀河隊的寶可夢調查員，為完成第一本寶可夢圖鑑而前往洗翠地區的各個地方調查，揭開寶可夢的生態之謎。', 0, N'Pokemon02.jpg', CAST(N'2022-01-28T00:00:00.000' AS DateTime), 3, NULL, NULL)
GO
INSERT [dbo].[Games] ([Id], [ChiName], [EngName], [Description], [IsRestrict], [GameCoverImg], [CreatedTime], [CreatedBackendMemberId], [ModifiedTime], [ModifiedBackendMemberId]) VALUES (6, N'星之卡比 新星同盟', N'Kirby Star Allies', N'在本作中玩家控制的卡比發出愛心邀請，讓原本是敵人的角色成為自己的夥伴，甚至能利用這些敵人的能力和自己構成「組合技」。', 0, N'KirbyStar.jpg', CAST(N'2018-03-16T00:00:00.000' AS DateTime), 1, NULL, NULL)
GO
INSERT [dbo].[Games] ([Id], [ChiName], [EngName], [Description], [IsRestrict], [GameCoverImg], [CreatedTime], [CreatedBackendMemberId], [ModifiedTime], [ModifiedBackendMemberId]) VALUES (7, N'暗黑破壞神IV', N'Diablo IV', N'在黑靈魂石遭到摧毀、三大罪惡之源遭到擊潰、死亡天使瑪瑟爾終於倒下之後，無數的生命消逝，而聖休亞瑞的居民則是在最黑暗的時代裡苦苦掙扎。多年以後，當萬物逐漸復甦之際，某個與這塊土地一樣古老的威脅開始蠢蠢欲動。在黑暗的儀式的召喚下，被放逐多年的莉莉斯回到了聖休亞瑞。而她的回歸也將開啟一個充滿黑暗和痛苦的新紀元。', 1, N'Diablo.jpg', CAST(N'2023-06-05T00:00:00.000' AS DateTime), 1, NULL, NULL)
GO
INSERT [dbo].[Games] ([Id], [ChiName], [EngName], [Description], [IsRestrict], [GameCoverImg], [CreatedTime], [CreatedBackendMemberId], [ModifiedTime], [ModifiedBackendMemberId]) VALUES (8, N'戰神', N'God of War', N'以北歐神話為核心設定，與之前以希臘神話為根基的七部作品大為不同。系列主人公克雷多斯會繼續擔任主角，並擁有一個名叫阿特柔斯的兒子。作為他兒子的導師和保護者，克雷多斯已經學會控制一直驅使他行動的怒氣，直面過去的自己，從復仇者成為一位父親，與兒子共同成長的故事。', 1, N'GodofWar.jpg', CAST(N'2018-04-20T00:00:00.000' AS DateTime), 3, NULL, NULL)
GO
INSERT [dbo].[Games] ([Id], [ChiName], [EngName], [Description], [IsRestrict], [GameCoverImg], [CreatedTime], [CreatedBackendMemberId], [ModifiedTime], [ModifiedBackendMemberId]) VALUES (9, N'薩爾達無雙 災厄啟示錄', N'Hyrule Warriors: Age of Calamity', N'背景設定在《薩爾達傳說 曠野之息》的100年前，林克和薩爾達公主必須在整個海拉魯集結盟友，抵禦邪惡的災厄加儂所領導的勢力，而災厄加儂正試圖重振旗鼓，摧毀海拉魯王國。', 0, N'Zelda03.jpg', CAST(N'2020-11-20T00:00:00.000' AS DateTime), 3, NULL, NULL)
GO
INSERT [dbo].[Games] ([Id], [ChiName], [EngName], [Description], [IsRestrict], [GameCoverImg], [CreatedTime], [CreatedBackendMemberId], [ModifiedTime], [ModifiedBackendMemberId]) VALUES (10, N'鬥陣特攻', N'Overwatch', N'玩家分為兩支隊伍，每隊1-6人。不同模式有不同的隊伍人數。玩家可從幾個預定英雄人物中選擇，每個英雄有自己獨特屬性和技能；這些英雄分為三類：攻擊型、肉盾型和輔助型。隊員合力保護並捍衛地圖上的控制點，或在有限時間內護送載具到達指定地點。', 0, N'Overwatch.jpg', CAST(N'2022-10-03T00:00:00.000' AS DateTime), 1, NULL, NULL)
GO
